import React from 'react';
import './Teaching.css';

function Teaching() {
    return (
        <div className="Teaching">

            <div className="TextZoneTeaching">
                <h1>Tecaching Assistance</h1>
                <h2>CYB1003 - Introduction to Cybersecurity</h2>
                <h2>Summer 2024</h2>
                <div className="PhotoTeaching">
                    <img src="cyb1003.jpg" alt="Cybersecurity" />

                </div>

                <p>I've been offered to take charged of 2 groups of first year student in Computer Science, at the Université du Québec  en Outaouais.
                    Under the supervision of Myria Bouhaddi PhD, I was in charge of the lab sessions, where I was able to help the students.</p>
                <p></p>
                <a href="https://etudier.uqo.ca/cours/description-cours/CYB1003" target="_blank" rel="noreferrer" >CYB1003</a>
            </div>

        </div>
    );
}

export default Teaching;
